import React, { Component } from "react";
import Child from "./../Child/Child";

export default class Parent extends Component {
  state = {
    userName: "mahmoud",
    lastName: "kadry",
    job: "idk",
    age: "26",
    productList: [
      { pName: "xaiomi", pPrice: 3000, pCat: "mobile", cound: 22, pKey: 1 },
      { pName: "apple", pPrice: 35000, pCat: "mobile", cound: 5, pKey: 2 },
      { pName: "samsung", pPrice: 45000, pCat: "mobile", cound: 219, pKey: 3 },
      { pName: "samsung", pPrice: 45000, pCat: "mobile", cound: 219, pKey: 5 },
      { pName: "samsung", pPrice: 45000, pCat: "mobile", cound: 219, pKey: 6 },
      { pName: "samsung", pPrice: 45000, pCat: "mobile", cound: 219, pKey: 69 },
    ],
  };
  productDelete = (index) => {
    console.log(index);
    {this.state.productList.splice()}
  };
  render() {
    return (
      <>
        <div className="container">
          <div className="row gy-2 gap-1 justify-content-between">
            {this.state.productList.map((product, index) => {
              return (
                <Child
                  product={product}
                  key={product.pKey}
                  productDelete={this.productDelete}
                  index={index}
                />
              );
            })}
          </div>
        </div>
      </>
    );
  }
}
